import React from "react";
import { Container, Grid, Typography, Link, Box, Divider } from "@mui/material";

const Footer = () => {
  return (
    <Box sx={{ backgroundColor: "#005f5f", color: "white", py: 3, mt: 5 }}>
      {" "}
      <Container>
        {" "}
        <Grid container spacing={3} justifyContent="center">
          {" "}
          <Grid item xs={12} sm={6} md={3}>
            {" "}
            <Typography variant="h6" gutterBottom>
              Trending on MMM
            </Typography>{" "}
            <Divider sx={{ backgroundColor: "white", mb: 1 }} />{" "}
            <Typography variant="body2">Credit Card</Typography>{" "}
            <Typography variant="body2">Personal Loan</Typography>{" "}
            <Typography variant="body2">Home Loan</Typography>{" "}
            <Typography variant="body2">Business Loan</Typography>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={6} md={3}>
            {" "}
            <Typography variant="h6" gutterBottom>
              More Options
            </Typography>{" "}
            <Divider sx={{ backgroundColor: "white", mb: 1 }} />{" "}
            <Typography variant="body2">Credit Score</Typography>{" "}
            <Typography variant="body2">Gold Loan</Typography>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={6} md={3}>
            {" "}
            <Typography variant="h6" gutterBottom>
              Company
            </Typography>{" "}
            <Divider sx={{ backgroundColor: "white", mb: 1 }} />{" "}
            <Link href="#" color="inherit" underline="always">
              About Us
            </Link>
            <br />{" "}
            <Link href="#" color="inherit" underline="always">
              Careers
            </Link>
            <br />{" "}
            <Link href="#" color="inherit" underline="always">
              Our Partners
            </Link>{" "}
          </Grid>{" "}
          <Grid item xs={12} sm={6} md={3}>
            {" "}
            <Typography variant="h6" gutterBottom>
              Download Our App
            </Typography>{" "}
            <Divider sx={{ backgroundColor: "white", mb: 1 }} />{" "}
            <Box>
              {" "}
              <img
                src='pic1.jpg'
                alt="Google Play"
                width="120"
                style={{ marginRight: 10 }}
              />{" "}
              <img src= 'pic2.jpg' alt="App Store" width="120" />{" "}
            </Box>{" "}
          </Grid>{" "}
        </Grid>{" "}
        <Box mt={3} textAlign="center">
          {" "}
          <Divider sx={{ backgroundColor: "white", mb: 1 }} />{" "}
          <Typography variant="body2">
            © 2025 MyMoneyMantra. All rights reserved.
          </Typography>{" "}
        </Box>{" "}
      </Container>{" "}
    </Box>
  );
};

export default Footer;
